import React from 'react'
import ProgramsCard from '../ProgramsCard/ProgramsCard'
import {programData} from "../../data/programsData"

function Programs() {

  console.log(programData)

  return (
    <div className='programs'>
    
      <div>
      {programData.map(()=>
        
          <ProgramsCard />

        )}
        </div>
    </div>
  )
  
}

export default Programs
